import React from 'react'
import './Card.css';
import Todo from './Todo';
import TodoDetails from './TodoDetails';


<TodoDetails/>


function Card() {
  return (
    <div className="container">
    <Todo  title={title} getDate={getDate}  getMonth={getMonth} getYear={getYear} description={description} />
  </div>
  )
}

export default Card
